const toggleClass=(()=>{let t=document.querySelectorAll("[data-bs-toggle-class]");for(let e=0;e<t.length;e++)t[e].addEventListener("click",e=>{e.preventDefault();let t=document.querySelector(e.currentTarget.dataset.bsTarget),l=e.currentTarget.dataset.bsToggleClass;t.classList.toggle(l)})})();export default toggleClass;
